SQL_STMT_U.val:
select avg (convert(int, left (b.arbeitszeit,2)) *60 *60 + CONVERT(int, substring (b.arbeitszeit,3,2)) * 60 + CONVERT(int, substring (b.arbeitszeit,5,2)))
from reparaturkopf a, reparatur_arbeitszeiten b, geraete c with(NOLOCK)
where a.ebene1=b.ebene1 and a.ebene2=b.ebene2 and a.ebene3=b.ebene3 and a.ebene4=b.ebene4 and a.auftnr=b.auftragsnr and a.ebene1=c.ebene1 and a.ebene2=c.ebene2 and a.ebene3=c.ebene3 and a.ebene4=c.ebene4 and a.idnr=c.idnr and a.ebene1=:3 and a.ebene2=:4 and a.ebene3=:5 and a.ebene4=:6 and c.modellnummer = :1 and b.fc = ':2'
